import React, {Component} from "react";

class search extends Component{

    constructor(){ 
        super();
        this.state = {
            searched: false,
        };
    }

    render(){
        //some html elements
        let searchResponse = (this.state.searched) ? "Results Page" : "Search Page";

        return(
            <div className="first">
                <h1>{searchResponse}</h1>
            </div>

        );



    }
}


export default search;
